import React from 'react';

const Fala = () => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    width: '300px',
    height: '100px',
  };

  const roundedBorderStyle = {
    flex: '1',
    background: '#3498db',
    borderRadius: '10px 10px 10px 0',
    padding: '20px',
    color: 'white',
  };

  const normalBorderStyle = {
    flex: '1',
    background: '#e74c3c',
    borderRadius: '0 0 10px 10px',
    padding: '20px',
    color: 'white',
  };

  return (
    <div style={containerStyle}>
      <div style={roundedBorderStyle}>
        This has rounded borders on top.
      </div>
      <div style={normalBorderStyle}>
        This has a normal border at the bottom.
      </div>
    </div>
  );
};

export default Fala;
